import React from "react";
import { MDBContainer, MDBRow, MDBCol } from "mdbreact";

const background = () => {
    return (
    <MDBContainer>
      <MDBRow>
        <img src="/Assets/sofiya-copy.jpg" alt="sofiya"></img>
      </MDBRow>
    </MDBContainer>
    );
    }

    export default background;
